import PropTypes from 'prop-types'
import React, { memo } from 'react'
import { ViewWrapper } from './style'

const ScrollView = memo((props) => {
  return (
    <ViewWrapper>
      <div>左边按钮</div>
      <div>右边按钮</div>

      <div className='slot'>
        {props.children}
      </div>
    </ViewWrapper>
  )
})

ScrollView.propTypes = {}

export default ScrollView
